import axios from "axios";

const api = axios.create({
  baseURL: "http://127.0.0.1:8000/",
  headers: {
    "Content-Type": "application/json",
  },
  mode: "cors",
  // withCredentials: true,  // Important for authentication
});
console.log(api)

export default api;
